package com.index;

public class diffferentiateex {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		Integer a =100;
		Integer b = 100;
		
		if(a == b) {
			System.out.println("equals in ==");
		}
		else {
			System.out.println("not equals in ==");
		}
		
		if(a.equals(b)) {
			System.out.println("equals in equals operator");
		}
		else {
			System.out.println("not equals in equals operator");
		}

	}

}
